        this.props.history.push("screens/Store");
    } 
    
    
    return(){

        <div className='bckg'>
            <h1 className="login">Login</h1>
            <input type="text" className="input" placeholder="username"></input>
            <button className="btnx" onClick={handleClick}>LOGIN</button>
            <h2 className="or">OR</h2>
            <button className="btnx">CONTINUE AS GUEST</button>
        </div>
      
    }
}

export default Login
